INSERT INTO `master_po` VALUES (1,'<ol><li>Waktu penyelesaian pekerjaan adalah 3 (Tiga) Bulan sejak PO ditandatangai kedua belah pihak.</li><li>Hasil harus sesuai dengan spesifikasi yang telah tercantum dengan PO ini.</li><li>Segala kerusakan dan kekurangan barang yang diterima pada saat penerimaan menjadi tanggung jawab vendor.</li><li>Apabila terjadi keterlambatan penyelesaian pekerjaan diberikan sanksi 1% (permil) perhari maksimal 5% dihitung dari nilai kontrak sebelum pajak.</li><li>Vendor wajib memberikan garansi atas alat yang diadakan selama 1 tahun.</li></ol>',NULL,'2022-01-07 04:05:31','<ol><li>Penagihan dapat dilakukan setelah pekerjaan selesai yang dituangkan ke dalam berita acara serah terima pekerjaan ke Universitas Pertamina.</li><li>Pembayaran dilakukan dalam 14 hari kerja sejak berkas penagihan lengkap diterima oleh fungsi keuangan Universitas Pertamina.</li></ol>');
