INSERT INTO `master_spph` VALUES (1,'<p>a) Copy Surat Izin Tempat Usaha / Surat Keterangan Domisili Perusahaan dari instansi yang berwenang&nbsp;<br>b) Copy Nomor Pokok Wajib Pajak (NPWP)<br>c) Copy Nomor Rekening Bank megandi<br>d) Copy surat pengukuhan pengusaha kena pajak<br>e) Copy Tanda Daftar Perusahaan (TDP)<br>f) Copy Surat Ijin Usaha Perdagangan (SIUP)<br>g) Copy neraca perusahaan (kualifikasi perusahaan) (Jika Ada)<br>h) Copy akte pendirian/anggaran dasar penyedia barang /jasa<br>i) Copy tanda pengenal pengurus<br>j) Daftar Pengalaman Kerja Sejenis.</p>','<p>Kriteria Penilaian:<br>1. Spesfikasi: Mandatory (Wajib Terpenuhi)<br>2. Garansi:<br>Minimum sebagai berikut:<br>a. Garansi penuh (service, penggantian part) selama 1 tahun, biaya dan pengerjaan ditanggungkan kepada pihak vendor selama penyebab kerusakan tersebut tidak disebabkan oleh kesalahan pemakaian.<br>b. Ketersediaan layanan service dan ketersediaan part minimal 5 tahun. Untuk tahun ke 2 sampai tahun ke 5 biaya akan dihitung berdasarkan kondisi layanan dan part. 3. Harga: 100%</p><p>Vendor wajib mencantukan sebagai berikut pada surat penawaran: 1. Spesifikasi lengkap dan rincian harga penawaran<br>2. Rincian garansi yang diberikan<br>3. Waktu Pekerjaan</p><p>* Spesifikasi/merk/brand (jika disebutkan) yang dituliskan pada surat ini adalah referensi minimum dengan tujuan supaya vendor mudah dalam menentukan produk yang akan ditawarkan, vendor boleh menawarkan dengan spesifikasi yang sama atau lebih baik/brand lain dengan syarat brand yang ditawarkan memiliki reputasi baik.</p>',NULL,'2022-02-22 03:19:24','/tmp/phpidvWrS');
/*!40000 ALTER TABLE `master_spph` ENABLE KEYS */;
UNLOCK TABLES;

